import "./hero.css";


const Hero =()=>{
    return(
        <section className="section-hero">
            <div className="hero-image-container">
                <img className="hero-img" src="/images/hero.svg" alt="hero"></img>
            </div>
        </section>
    );
};

export default Hero;
